import { useState } from "react";

const Table = (props) => {
  const [finalData, setFinalData] = useState(<tr></tr>);
  for (let i = 0; i < props.data.length; i++) {
    setFinalData(
      <tr>
        <td>{i + 1}</td>
        <td>{props.data[i].savingsEndOfYear}</td>
        <td>{props.data[i].yearlyInterest}</td>
        <td>{props.data[i].yearlyContribution}</td>
        <td>{props.data[i].savingsEndOfYear}</td>
      </tr>
    );
  }
  console.log(finalData)
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>{finalData}</tbody>
    </table>
  );
};

export default Table;
